import React from 'react';
import { Router, Route, Switch, Redirect, useHistory } from 'react-router-dom';
import { createBrowserHistory } from "history";

function App() {
    const history = useHistory();

    return (
        <div id="app">
            <Router history={history}>
                <Switch>
                    <Route path="/" />
                </Switch>
            </Router>
        </div>
    );
}

export default App;
